import React from 'react';
import './indexTemplate.css';

const indexTemplate = ({form, children}) => {
    return (
	<main className="index-template">
	  <div className="title">
	    오늘 할일
	  </div>
	  <section className="form-wrapper">
	    {form}
	  </section>
	  <section className="todos-wrapper">
	    {children}
	  </section>
	</main>
    );
};

export default indexTemplate;
